res (ver arriba)\" | tee -a \"$LOG_FILE\"\nelse\n    echo \"‚ùå SwiftLint: Fall√≥ con c√≥digo $SWIFTLINT_RESULT\" | tee -a \"$LOG_FILE\"\nfi\n\n# No bloquear el build aunque haya errores\necho \"üèÅ SwiftLint finalizado\" | tee -a \"$LOG_FILE\"\nexit 0\n";
